function VideoPlaylist(props) {
  return <h2 className="side-video__title">NEXT VIDEO"</h2>;
  <ul className="side-video__list">
    {props.videos.map((video) => {
      <li>
        <img src={props.videos.image} alt="" />
        <h2>{props.videos.title}</h2>
      </li>;
    })}
  </ul>;
}

export default VideoPlaylist;
